import React, { Component } from 'react';
import Navbar from '../components/Nav';
import background from "../assets/top half background.png";
import "../App.css"

class Homepage extends Component {
  constructor(props) {
    super(props);
    this.state = {

    };
  }

  render() {
    return (
      <div style={{width:'100vw', backgroundColor:'#02003d',position:'absolute',zIndex:'-3'}} >

        <div style={{width:'100vw', backgroundColor:'#02003d'}}>
          <div  style={{width:'100%', height:'100%', backgroundColor:'#02003d', position:'absolute',zIndex:'-2'}}></div>
        <img src={background} alt="" style={{position:'absolute', zIndex:'-1', width:'100%'}} className="topbackgroundImage"/>
        </div>
        <Navbar/>
        <div style={{width:'100vw', marginTop:'4%'}} className="d-flex justify-content-center">
          <div style={{width:'70%', height:'60vh'}}>

          </div>

        </div>

        <div style={{width:'100vw', marginTop:'4%',padding:'2%'}} className="d-flex justify-content-center">
          <div style={{width:'70%', height:'40vh'}} className="d-flex flex-row">
            <div style={{width:'10%'}} className="d-flex justify-content-center ">
              <h1 className="Number">01</h1>
            </div>
            <div style={{width:'50%', backgroundColor:'black'}}></div>
            <div style={{width:'40%', backgroundColor:'black'}}></div>
          </div>

        </div>

        <div style={{width:'100vw', marginTop:'4%'}} className="d-flex justify-content-center">
          <div style={{width:'70%', height:'40vh', backgroundColor:'black'}}>

          </div>

        </div>

        <div style={{width:'100vw', marginTop:'4%'}} className="d-flex justify-content-center">
          <div style={{width:'70%', height:'40vh', backgroundColor:'black'}}>

          </div>

        </div>

        <div style={{width:'100vw', marginTop:'4%'}} className="d-flex justify-content-center">
          <div style={{width:'70%', height:'40vh', backgroundColor:'black'}}>

          </div>

        </div>

        <div style={{width:'100vw', marginTop:'4%'}} className="d-flex justify-content-center">
          <div style={{width:'70%', height:'40vh', backgroundColor:'black'}}>

          </div>

        </div>


      </div>
    );
  }
}

export default Homepage;
